import React from 'react'
import Itemchild from './Itemchild'

function Item({name,items}) {
  return (
    <div>
      <div className='itemlist-item'>{name}</div>

      {Object.keys(items).map((keyName, i) => (
            <div key={i} className='itemlist-item'>
                <Itemchild itemObject={items[keyName]}/>
            </div>
        ))}

    </div>
  )
}

export default Item
